import{_ as t,a as e,b as r,c as l}from"./chunks/settings_view_general_rtk_gps.CmoByRPo.js";import{_ as a,c as n,o as d,ab as s}from"./chunks/framework.CUflZczI.js";const P=JSON.parse('{"title":"RTK GNSS (GPS)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/gps_compass/rtk_gps.md","filePath":"uk/gps_compass/rtk_gps.md"}'),i={name:"uk/gps_compass/rtk_gps.md"},o=s('<h1 id="rtk-gnss-gps" tabindex="-1">RTK GNSS (GPS) <a class="header-anchor" href="#rtk-gnss-gps" aria-label="Permalink to &quot;RTK GNSS (GPS)&quot;">​</a></h1><p><a href="https://en.wikipedia.org/wiki/Real_Time_Kinematic" target="_blank" rel="noreferrer">Системи GNSS/GPS з реальним кінематичним положенням (RTK)</a> забезпечують точність на рівні сантиметрів, що дозволяє використовувати PX4 у таких застосунках, як точне обстеження (де важлива точність до кожного сантиметра).</p><p>Ця функція потребує <em>QGroundControl</em>, який працює на ноутбуці/ПК та транспортного засобу з бездротовим або телеметричним радіозв&#39;язком з наземним лаптопом.</p><div class="info custom-block"><p class="custom-block-title">Деякі налаштування RTK GNSS можуть надавати інформацію про курс/головний напрямок як альтернативу компасу:</p><ul><li><a href="./../gps_compass/u-blox_f9p_heading.html">Напрямок за допомогою RTK GPS з подвійним u-blox F9P</a>.</li><li>GPS безпосередньо виводить курс (див. таблицю нижче).</li></ul></div><h2 id="пристроі-що-підтримуються" tabindex="-1">Пристрої, що підтримуються <a class="header-anchor" href="#пристроі-що-підтримуються" aria-label="Permalink to &quot;Пристрої, що підтримуються&quot;">​</a></h2><p>PX4 підтримує GPS <a href="https://www.u-blox.com/en/product/neo-m8p" target="_blank" rel="noreferrer">u-blox M8P</a>, <a href="https://www.u-blox.com/en/product/zed-f9p-module" target="_blank" rel="noreferrer">u-blox F9P</a> та <a href="https://www.trimble.com/Precision-GNSS/MB-Two-Board.aspx" target="_blank" rel="noreferrer">Trimble MB-Two</a>, а також продукцію, що включає їх.</p><p>Список сумісних пристроїв RTK нижче, які очікуються для роботи з PX4 (він виключає припинені пристрої). Таблиця вказує пристрої, які також виводять курсову відмітку, а також можуть надавати курсову відмітку, коли використовуються дві одиниці на транспортному засобі. Він також відзначає пристрої, які підключаються через CAN шину, та ті, які підтримують PPK (пост-процесуальну кінематику).</p><table><thead><tr><th style="text-align:left;">Пристрій</th><th style="text-align:center;">GPS</th><th style="text-align:center;">Компас</th><th style="text-align:center;"><a href="./../dronecan/">DroneCAN</a></th><th style="text-align:center;"><a href="#configuring-gps-as-yaw-heading-source">GPS Yaw</a></th><th style="text-align:center;"><a href="./../gps_compass/u-blox_f9p_heading.html">Подвійний курс F9P GPS</a></th><th style="text-align:center;">PPK</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://arkelectron.com/product/ark-rtk-gps/" target="_blank" rel="noreferrer">ARK RTK GPS</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">ICM42688p</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_cuav_c-rtk.html">CUAV C-RTK GPS</a></td><td style="text-align:center;">M8P/M8N</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_cuav_c-rtk2.html">CUAV C-RTK2</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_cuav_c-rtk-9ps.html">CUAV C-RTK 9Ps GPS</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">RM3100</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_cuav_c-rtk.html">CUAV C-RTK2 PPK/RTK GNSS</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">RM3100</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_hex_hereplus.html">CubePilot Here+ RTK GPS</a></td><td style="text-align:center;">M8P</td><td style="text-align:center;">HMC5983</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="https://www.cubepilot.org/#/here/here3" target="_blank" rel="noreferrer">CubePilot Here3 CAN GNSS GPS (M8N)</a></td><td style="text-align:center;">M8P</td><td style="text-align:center;">ICM20948</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="https://store-drotek.com/911-sirius-rtk-gnss-rover-f9p.html" target="_blank" rel="noreferrer">Drotek SIRIUS RTK GNSS ROVER (F9P)</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">RM3100</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_fem_mini2.html">Femtones MINI2 Receiver</a></td><td style="text-align:center;">FB672, FB6A0</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_freefly.html">Freefly RTK GPS</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">IST8310</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="https://holybro.com/products/h-rtk-f9p-ultralight" target="_blank" rel="noreferrer">Holybro H-RTK F9P Ultralight</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">IST8310</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_holybro_h-rtk-f9p.html">Holybro H-RTK F9P Helical or Base</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">IST8310</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="https://holybro.com/products/dronecan-h-rtk-f9p-helical" target="_blank" rel="noreferrer">Holybro DroneCAN H-RTK F9P Helical</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">BMM150</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_holybro_h-rtk-f9p.html">Holybro H-RTK F9P Rover Lite</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">IST8310</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="https://holybro.com/products/dronecan-h-rtk-f9p-rover" target="_blank" rel="noreferrer">Holybro DroneCAN H-RTK F9P Rover</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">BMM150</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_holybro_h-rtk-m8p.html">Holybro H-RTK M8P GNSS</a></td><td style="text-align:center;">M8P</td><td style="text-align:center;">IST8310</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_holybro_unicore_um982.html">Holybro H-RTK Unicore UM982 GPS</a></td><td style="text-align:center;">UM982</td><td style="text-align:center;">IST8310</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_locosys_r1.html">LOCOSYS Hawk R1</a></td><td style="text-align:center;">MC-1612-V2b</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_locosys_r2.html">LOCOSYS Hawk R2</a></td><td style="text-align:center;">MC-1612-V2b</td><td style="text-align:center;">IST8310</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="https://store.mrobotics.io/product-p/m10020d.htm" target="_blank" rel="noreferrer">mRo u-blox ZED-F9 RTK L1/L2 GPS</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/septentrio_asterx-rib.html">Septentrio AsteRx-m3 Pro</a></td><td style="text-align:center;">AsteRx</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;">Положення двох антен Septentrio</td><td style="text-align:center;">✓</td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/septentrio_mosaic-go.html">Septentrio mosaic-go</a></td><td style="text-align:center;">mosaic X5 / mosaic H</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;">Голова Септентріо подвійної антени</td><td style="text-align:center;">✓</td></tr><tr><td style="text-align:left;"><a href="https://store-drotek.com/911-sirius-rtk-gnss-rover-f9p.html" target="_blank" rel="noreferrer">SIRIUS RTK GNSS ROVER (F9P)</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="https://www.sparkfun.com/products/15136" target="_blank" rel="noreferrer">SparkFun GPS-RTK2 Board - ZED-F9P</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;"><a href="./../gps_compass/rtk_gps_trimble_mb_two.html">Trimble MB-Two</a></td><td style="text-align:center;">F9P</td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;">✓</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table><p>Примітки:</p><ul><li>✓ або конкретний номер артикулу вказує на те, що функція підтримується, тоді як ✗ або пусте поле вказує на те, що функція не підтримується. &quot;?&quot; означає &quot;невідомо&quot;.</li><li>Там, де це можливо і доречно, використовується назва деталі (наприклад, ✓ у колонці GPS вказує на наявність GPS-модуля, але деталь невідома).</li><li>Деякі RTK-модулі можна використовувати лише в певній ролі (база або ровер), тоді як інші можна використовувати як взаємозамінні.</li><li>У списку може бути відсутнє деяке зняте з виробництва обладнання, яке все ще підтримується. Наприклад, <a href="./../gps_compass/rtk_gps_hex_hereplus.html">CubePilot Here+ RTK GPS</a> більше не випускається і може бути вилучений зі списку у наступному релізі. Перевірте попередні версії, якщо тут не згадано модуль, який перестали випускати.</li></ul><h2 id="налаштування-конфігурація-розташування" tabindex="-1">Налаштування/Конфігурація розташування <a class="header-anchor" href="#налаштування-конфігурація-розташування" aria-label="Permalink to &quot;Налаштування/Конфігурація розташування&quot;">​</a></h2><p>Позиціонування RTK вимагає <em>пару</em> <a href="#supported-devices">пристроїв RTK GNSS</a>: &quot;базового&quot; для земельної станції та &quot;роувера&quot; для транспортного засобу.</p><p>Крім того, вам знадобиться:</p><ul><li><em>Ноутбук/ПК</em> з QGroundControl (QGroundControl для Android/iOS не підтримує RTK)</li><li>Транспортний засіб із WiFi або телеметричним радіозв&#39;язком з ноутбуком.</li></ul><div class="info custom-block"><p class="custom-block-title"><em>QGroundControl</em> with a base module can theoretically enable RTK GPS for multiple vehicles/rover modules. На момент написання цього випадку використання цей випадок не був протестований.</p></div><h3 id="налаштування-обладнання" tabindex="-1">Налаштування обладнання <a class="header-anchor" href="#налаштування-обладнання" aria-label="Permalink to &quot;Налаштування обладнання&quot;">​</a></h3><h4 id="модуль-rover-rtk-транспортнии" tabindex="-1">Модуль Rover RTK (Транспортний) <a class="header-anchor" href="#модуль-rover-rtk-транспортнии" aria-label="Permalink to &quot;Модуль Rover RTK (Транспортний)&quot;">​</a></h4><p>Спосіб підключення та необхідні кабелі/роз&#39;єми залежать від вибраного модуля RTK (і від <a href="./../flight_controller/">контролера польоту</a>).</p><p>Більшість з&#39;єднані через порт GPS контролера польоту, так само, як будь-який інший модуль GPS. Деякі з них підключені до шини <a href="./../can/">CAN</a> (тобто використовують <a href="./../dronecan/">DroneCAN</a>).</p><p>See <a href="#supported-devices">documentation for the selected device</a>, general <a href="./../gps_compass/#hardware-setup">GNSS Hardware/Configuration Setup</a>, and <a href="./../dronecan/">DroneCAN</a> for more information on wiring and configuration.</p><h4 id="базовии-модуль-rtk-наземнии" tabindex="-1">Базовий модуль RTK (наземний) <a class="header-anchor" href="#базовии-модуль-rtk-наземнии" aria-label="Permalink to &quot;Базовий модуль RTK (наземний)&quot;">​</a></h4><p>Підключіть базовий модуль до <em>QGroundControl</em> за допомогою USB. Модуль бази не повинен зміщуватися, коли його використовують.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Виберіть позицію, де базовий модуль не потрібно буде переміщувати, має чіткий вид на небо і добре відокремлений від будь-яких будівель. Часто корисно підняти базовий GPS, використовуючи штатив або монтувавши його на дах.</p></div><h4 id="телеметріине-радіо-wifi" tabindex="-1">Телеметрійне радіо/WiFi <a class="header-anchor" href="#телеметріине-радіо-wifi" aria-label="Permalink to &quot;Телеметрійне радіо/WiFi&quot;">​</a></h4><p>Автомобіль і ноутбук керування на землі повинні бути підключені через <a href="./../telemetry/">Wi-Fi або радіозв&#39;язок телеметрії</a>.</p><p>Посилання <em>має</em> використовувати протокол MAVLink 2, оскільки він більш ефективно використовує канал. Це повинно бути встановлено за замовчуванням, але якщо ні, слід дотримуватися <a href="#mavlink2">конфігураційні інструкції MAVLink2</a> нижче.</p><h3 id="процес-підключення-rtk" tabindex="-1">Процес підключення RTK <a class="header-anchor" href="#процес-підключення-rtk" aria-label="Permalink to &quot;Процес підключення RTK&quot;">​</a></h3><p>Підключення RTK GPS насправді просте:</p><ol><li>Розпочніть виконання <em>QGroundControl</em> та підключіть базовий RTK GPS через USB до наземної станції. Пристрій визнається автоматично.</li><li>Запустіть автомобіль і переконайтеся, що він підключений до <em>QGroundControl</em>.</li></ol><div class="tip custom-block"><p class="custom-block-title">TIP</p><p><em>QGroundControl</em> показує значок статусу RTK GPS у верхній панелі значків, коли підключено пристрій RTK GPS (на додачу до звичайного значка статусу GPS). Іконка червона, поки налаштовується RTK, а потім змінюється на білу, коли RTK GPS активний. Ви можете натиснути на піктограму, щоб побачити поточний стан та точність RTK.</p></div><ol><li><p><em>QGroundControl</em> потім починає процес налаштування RTK (відомий як &quot;Survey-In&quot;).</p><p>Survey-In - це процедура запуску для отримання точної оцінки положення базової станції. Процес зазвичай триває кілька хвилин (він закінчується після досягнення мінімального часу та точності, вказаних у налаштуваннях <a href="#rtk-gps-settings">RTK</a>).</p><p>Ви можете відстежити прогрес, натиснувши на піктограму стану RTK GPS.</p><p><img src="'+t+'" alt="survey-in"></p></li><li><p>Після завершення опитування:</p><ul><li><p>Іконка RTK GPS змінюється на білу, а <em>QGroundControl</em> починає транслювати дані про позицію на транспортний засіб:</p><p><img src="'+e+'" alt="RTK streaming"></p></li><li><p>Транспортний GPS переходить у режим RTK. Новий режим відображається у <em>звичайному</em> піктограмі стану GPS (&lt;0&gt;звичайний&lt;/0&gt; блокування GPS RTK 3D):</p><p><img src="'+r+'" alt="RTK GPS Status"></p></li></ul></li></ol><h3 id="налаштування-gps-як-джерело-розділення-курсування" tabindex="-1">Налаштування GPS як Джерело розділення/Курсування <a class="header-anchor" href="#налаштування-gps-як-джерело-розділення-курсування" aria-label="Permalink to &quot;Налаштування GPS як Джерело розділення/Курсування&quot;">​</a></h3><p>GPS може бути використаний як джерело для об&#39;єднання повороту, коли використовуються модулі, де <em>вихід повороту підтримується пристроєм</em> (наприклад, <a href="./../gps_compass/rtk_gps_trimble_mb_two.html">Trimble MB-Two</a>) або при використанні деяких <a href="./../gps_compass/u-blox_f9p_heading.html">Налаштувань RTK GPS з подвійними u-blox F9P</a>.</p><p>Під час використання GPS для злиття по курсу вам доведеться налаштувати наступні параметри:</p><table><thead><tr><th>Параметр</th><th>Налаштування</th></tr></thead><tbody><tr><td><a href="./../advanced_config/parameter_reference.html#GPS_YAW_OFFSET">GPS_YAW_OFFSET</a></td><td>Кут, який утворює <em>базова лінія</em> (лінія між двома GPS антенами) відносно осі x транспортного засобу (передня/задня вісь, як показано <a href="./../config/flight_controller_orientation.html#calculating-orientation">тут</a>).</td></tr><tr><td><a href="./../advanced_config/parameter_reference.html#EKF2_GPS_CTRL">EKF2_GPS_CTRL</a></td><td>Встановіть бітову позицію 3 &quot;Напрямок подвійної антени&quot; на <code>1</code> (тобто додайте 8 до значення параметра).</td></tr></tbody></table><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Якщо ви використовуєте цю функцію, всі інші конфігурації мають бути налаштовані стандартно (наприклад, <a href="./../gps_compass/rtk_gps.html#positioning-setup-configuration">RTK Positioning</a>).</p></div><h3 id="додаткова-конфігурація-px4" tabindex="-1">Додаткова конфігурація PX4 <a class="header-anchor" href="#додаткова-конфігурація-px4" aria-label="Permalink to &quot;Додаткова конфігурація PX4&quot;">​</a></h3><p>Можливо, знадобиться змінити наступні налаштування (використовуючи <em>QGroundControl</em>).</p><h4 id="налаштування-rtk-gps" tabindex="-1">Налаштування RTK GPS <a class="header-anchor" href="#налаштування-rtk-gps" aria-label="Permalink to &quot;Налаштування RTK GPS&quot;">​</a></h4><p>Налаштування RTK GPS вказано у <em>QGroundControl</em> <a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/settings_view/general.html#rtk_gps" target="_blank" rel="noreferrer">Загальних налаштуваннях</a> (<strong>SettingsView &gt; Загальні налаштування &gt; Налаштування RTK GPS</strong>).</p><p><img src="'+l+'" alt="RTK GPS Setup"></p><p>Ці параметри визначають мінімальну тривалість та мінімальну точність для завершення процесу налаштування RTK GPS (відомий як &quot;Survey-In).</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Можна зберегти й повторно використовувати базове положення, щоб заощадити час: виконайте Вимірювання-In один раз, виберіть <em>Використовувати Вказану Базову Позицію</em> та натисніть <strong>Зберегти Поточне Базове Положення</strong>, щоб скопіювати значення для останнього вимірювання. Значення будуть збережені після перезавантажень QGC до тих пір, поки їх не змінять.</p></div><h4 id="mavlink2" tabindex="-1">MAVLink2 <a class="header-anchor" href="#mavlink2" aria-label="Permalink to &quot;MAVLink2&quot;">​</a></h4><p>Протокол MAVLink2 повинен бути використаний, оскільки він ефективніше використовує канали з низькою пропускною здатністю. Це має бути увімкнено за замовчуванням на останніх збірках.</p><p>Для забезпечення використання MAVLink2:</p><ul><li>Оновіть прошивку модуля телеметрії до останньої версії (див. <a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/setup_view/firmware.html" target="_blank" rel="noreferrer">QGroundControl &gt; Налаштування &gt; Прошивка</a>).</li><li>Встановіть <a href="./../advanced_config/parameter_reference.html#MAV_PROTO_VER">MAV_PROTO_VER</a> на 2 (див. <a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/setup_view/parameters.html" target="_blank" rel="noreferrer">QGroundControl Налаштування &gt; Параметри</a>)</li></ul><h4 id="налаштування" tabindex="-1">Налаштування <a class="header-anchor" href="#налаштування" aria-label="Permalink to &quot;Налаштування&quot;">​</a></h4><p>Вам може додатково знадобитися налаштувати деякі параметри, оскільки параметри за замовчуванням налаштовані з припущенням точності GPS в порядку метрів, а не сантиметрів. Наприклад, ви можете зменшити <a href="./../advanced_config/parameter_reference.html#EKF2_GPS_V_NOISE">EKF2_GPS_V_NOISE</a> та <a href="./../advanced_config/parameter_reference.html#EKF2_GPS_P_NOISE">EKF2_GPS_P_NOISE</a> на 0.2.</p><h4 id="подвіині-приимачі" tabindex="-1">Подвійні приймачі <a class="header-anchor" href="#подвіині-приимачі" aria-label="Permalink to &quot;Подвійні приймачі&quot;">​</a></h4><p>Другий приймач GPS може бути використаний як резервний (RTK або не RTK). Дивіться розділ <a href="./../advanced_config/tuning_the_ecl_ekf.html#gps">Конфігурація GPS EKF2</a>.</p><h2 id="додаткова-інформація" tabindex="-1">Додаткова інформація <a class="header-anchor" href="#додаткова-інформація" aria-label="Permalink to &quot;Додаткова інформація&quot;">​</a></h2><ul><li><a href="./../advanced/rtk_gps.html">RTK-GPS (Інтеграція PX4)</a>: Інформація розробника про інтеграцію підтримки RTK-GPS до PX4.</li><li><a href="https://en.wikipedia.org/wiki/Real_Time_Kinematic" target="_blank" rel="noreferrer">Реально-часова кінематика</a> (Wikipedia)</li></ul>',53),c=[o];function g(p,h,x,y,m,_){return d(),n("div",null,c)}const S=a(i,[["render",g]]);export{P as __pageData,S as default};
